import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'Name',
        selector: row => row.title,
    },
    {
        name: 'Surname',
        selector: row => row.year,
    },
    {
        name: 'Birthday',
        selector: row => row.year,
    },
    {
        name: 'Birthplace',
        selector: row => row.year,
    },
];

function DataList() {
    return (
        <DataTable
            columns={columns}
            data={data}
        />
    );
}
